  CONSTRAINT `tblcocktails_ibfk_2` FOREIGN KEY (`idGlass`) REFERENCES `tblglasses` (`id`),
  CONSTRAINT `tblcocktails_ibfk_3` FOREIGN KEY (`idColor`) REFERENCES `tblcolors` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=175 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;
