INSERT INTO `tblcocktails` VALUES (1,'151 Florida Bushwacker',9,1,2,10,'Combine all ingredients. Blend until smooth. Garnish with chocolate shavings if desired.','151-Florida-Bushwacker.webp',0),(2,'155 Belmont',2,1,20,2,'Blend with ice. Serve in a wine glass. Garnish with carrot.','155-Belmont.webp',0),(3,'24k nightmare',10,1,18,8,'Add over ice,shake and pour.','24k-nightmare.webp',0),(4,'252',10,1,18,1,'Add both ingredients to shot glass, shoot, and get drunk quick','252.webp',0),(5,'3 Wise Men',10,1,7,8,'Put them them in a glass... and slam it to tha head.','3-Wise-Men.webp',0),(6,'3-Mile Long Island Iced Tea',6,1,7,8,'Fill 14oz glass with ice and alcohol. Fill 2/3 glass with cola and remainder with sweet & sour. Top with dash of bitters and lemon wedge.','3-Mile-Long-island-iced-tea.webp',0),(7,'50/50',6,1,7,9,'Fill glass with crushed ice. Add vodka. Add a splash of grand-marnier. Fill with o.j.','50-50.webp',0),(8,'57 Chevy with a White License Plate',2,1,10,2,'1. Fill a rocks glass with ice 2.add white creme de cacao and vodka 3.stir','57-Chevy-with-a-White-License-Plate.webp',0),(9,'69 Special',6,1,7,9,'Pour 2 oz. gin. Add 4 oz. 7-up. Add Lemon Juice for flavor. If you are weak, top up glass with more 7-Up.','69-Special.webp',0),(10,'747',10,1,18,1,'Pour kaluha, then Baileys, then Frangelico not chilled and not layered -- SERVE!!!','747.webp',0),(11,'747 Drink',2,1,10,1,'Fill a Collins glass with ice.\nPour in vodka, lime cordial, and cranberry juice.\nFill up with Sprite.\nGarnish with a Lime wheel or some cranberries','747-drink.webp',0),(12,'A J',6,1,5,10,'Shake ingredients with ice, strain into a cocktail glass, and serve.','A-J.webp',0),(13,'A1',2,1,5,1,'Pour all ingredients into a cocktail shaker, mix and serve over ice into a chilled glass.','A-1.webp',0),(14,'Abilene',6,1,10,3,'Pour all of the ingredients into a highball glass almost filled with ice cubes. Stir well.','Abilene.webp',0),(15,'Acapulco',6,1,15,3,'Combine and shake all ingredients (except mint) with ice and strain into an old-fashioned glass over ice cubes. Add the sprig of mint and serve.','Acapulco.webp',0),(16,'Ace',2,1,13,2,'Shake all the ingredients in a cocktail shaker and ice then strain in a cold glass.','ACE.webp',0),(17,'ACID',10,1,18,8,'Poor in the 151 first followed by the 101 served with a Coke or Dr Pepper chaser.','ACID.webp',0),(18,'Affinity',6,1,5,1,'In a mixing glass half-filled with ice cubes, combine all of the ingredients. Stir well. Strain into a cocktail glass.','Affinity.webp',0),(19,'After sex',6,1,10,2,'Pour the vodka and creme over some ice cubes in a tall glass and fill up with juice. to make it beuty full make the top of the glass with a grenadine and sugar','After-sex.webp',0),(20,'Afterglow',2,0,10,1,'Mix. Serve over ice.','Afterglow.webp',0),(21,'Alexander',6,1,5,3,'Shake all ingredients with ice and strain contents into a cocktail glass. Sprinkle nutmeg on top and serve.','Alexander.webp',0),(22,'Allegheny',6,1,5,2,'Shake all ingredients (except lemon peel) with ice and strain into a cocktail glass. Top with the twist of lemon peel and serve.','Allegheny.webp',0),(23,'Almeria',6,1,5,8,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a cocktail glass.','Almeria.webp',0),(24,'Americano',6,1,7,1,'Pour the Campari and vermouth over ice into glass, add a splash of soda water and garnish with half orange slice.','Americano.webp',0),(25,'Applecar',6,1,5,8,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Applecar.webp',0),(26,'Applejack',2,1,5,8,'Add all ingredients into mixing glass, chill and strain into cocktail glass','Applejack.webp',0),(27,'AT&T',6,1,10,9,'Pour Vodka and Gin over ice, add Tonic and Stir','AT&T.webp',0),(28,'Autodaf',6,1,10,9,'Mix and fill up with soda water. Drunk by finns on a sunny day any time of the year and day.','Autodaf.webp',0),(29,'Aviation',2,1,5,6,'Add all ingredients into cocktail shaker filled with ice. Shake well and strain into cocktail glass. Garnish with a cherry.','Aviation.webp',0),(30,'Bahama Mama',2,1,10,1,'Add 2 parts club soda or more or less to taste.\n\nMix it all together and pour over a bunch of ice. Drink with a straw.','Bahama-Mama.webp',0),(31,'Balmoral',6,1,5,8,'In a mixing glass half-filled with ice cubes, combine all of the ingredients. Stir well. Strain into a cocktail glass.','Balmoral-.webp',0),(32,'Barracuda',6,1,12,3,'Shake pour ingredients with ice. Strain into glass, top with Sparkling wine.','Barracuda.webp',0),(33,'Bellini',6,1,4,3,'Pour peach pure into chilled flute, add sparkling wine. Stir gently.','Bellini.webp',0),(34,'Big Red',10,1,18,1,'Pour ingredients into 1 ounce shot glass','Big-Red.webp',0),(35,'Bijou',2,1,5,8,'Stir in mixing glass with ice and strain','Bijou.webp',0),(36,'Blackthorn',6,1,5,8,'Stir sloe gin and vermouth with ice and strain into a cocktail glass. Add the twist of lemon peel and serve.','Blackthorn.webp',0),(37,'Bluebird',6,1,5,5,'In a mixing glass half-filled with crushed ice, combine the gin, triple sec, Curacao, and bitters. Stir well. Strain into a cocktail glass and garnish with the lemon twist and the cherry.','Bluebird.webp',0),(38,'Boomerang',6,1,5,8,'In a mixing glass half-filled with ice cubes, combine the gin, vermouth, bitters, and maraschino liqueur. Stir well. Strain into a cocktail glass and garnish with the cherry.','Boomerang.webp',0),(39,'Bora Bora',2,0,10,1,'Prepare in a blender or shaker, serve in a highball glass on the rocks. Garnish with 1 slice of pineapple and one cherry.','Bora-Bora.webp',0),(40,'Boston Sour',6,1,19,3,'Shake juice of lemon, powdered sugar, blended whiskey, and egg white with cracked ice and strain into a whiskey sour glass. Add the slice of lemon, top with the cherry, and serve.','Boston-Sour.webp',0),(41,'Boxcar',6,1,19,8,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a sour glass.','Boxcar.webp',0),(42,'Bramble',6,1,15,1,'Fill glass with crushed ice. Build gin, lemon juice and simple syrup over. Stir, and then pour blackberry liqueur over in a circular fashion to create marbling effect. Garnish with two blackberries and lemon slice.','Bramble.webp',0),(43,'Brigadier',2,1,9,1,'Mix ingredients in a warmed mug and stir.','Brigadier.webp',0),(44,'Broadside',2,1,10,9,'Half fill the glass with ice cubes. Crush the wormwood and add to ice. Pour rum, scotch and butters, then serve!','Broadside.webp',0),(45,'Brooklyn',2,1,5,8,'Combine ingredients with ice and stir until well-chilled. Strain into a chilled cocktail glass.','Brooklyn.webp',0),(46,'Bubble Gum',10,1,18,7,'Layer in order into a shot glass.','Bubble-Gum.webp',0),(47,'Buccaneer',1,1,3,2,'Pour the corona into an 18oz beer glass pour the bacardi limon into the beer stir very gently','Buccaneer.webp',0),(48,'Caipirinha',6,1,15,9,'Place lime and sugar into old fashioned glass and muddle (mash the two ingredients together using a muddler or a wooden spoon). Fill the glass with ice and add the Cachaa.','Caipirinha.webp',0),(49,'Caipirissima',6,1,7,9,'Same as Caipirinha but instead of cachaca you add WHITE RUM. It\'\'s great!!!!!!!!','Caipirissima.webp',0),(50,'Campari Beer',1,1,2,1,'Use a 15 oz glass. Add Campari first. Fill with beer.','Campari-Beer.webp',0),(51,'Casa Blanca',6,1,5,10,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Casa-Blanca.webp',0),(52,'Casino',6,1,5,8,'Pour all ingredients into shaker with ice cubes. Shake well. Strain into chilled cocktail glass. Garnish with a lemon twist and a maraschino cherry. Serve without a straw.','Casino.webp',0),(53,'Casino Royale',6,1,19,2,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a sour glass.','Casino-Royale.webp',0),(54,'Cherry Rum',6,1,5,1,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Cherry-Rum.webp',0),(55,'Chicago Fizz',6,1,10,1,'Shake all ingredients (except carbonated water) with ice and strain into a highball glass over two ice cubes. Fill with carbonated water, stir, and serve.','Chicago-Fizz.webp',0),(56,'Chocolate Drink',3,0,6,8,'Melt the bar in a small amount of boiling water. Add milk. Cook over low heat, whipping gently (with a whisk, i would assume) until heated well. Don\'\'t let it boil! Serve in coffee mug.','Chocolate-Drink.webp',0),(57,'Citrus Coke',11,1,10,8,'Pour half of coke in a glass. Then add Bacardi and top it off with the remaining coke. Stir and drink up!','Citrus-Coke.webp',0),(58,'City Slicker',6,1,5,1,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a cocktail glass.','City-Slicker.webp',0),(59,'Clove Cocktail',6,1,5,2,'Stir all ingredients with ice, strain into a cocktail glass, and serve.','Clove-Cocktail.webp',0),(60,'Clover Club',6,1,5,1,'Dry shake ingredients to emulsify, add ice, shake and served straight up.','Clover-Club.webp',0),(61,'Coffee-Vodka',5,1,7,8,'Boil water and sugar until dissolved. Turn off heat. Slowly add dry instant coffee and continue stirring. Add a chopped vanilla bean to the vodka, then combine the cooled sugar syrup and coffee solution with the vodka. Cover tightly and shake vigorously each day for 3 weeks. Strain and filter. Its also best to let the sugar mixture cool completely so the vodka won\'\'t evaporate when its added. If you like a smoother feel to the liqueur you can add about 1 teaspoon of glycerine to the finished product.','Coffee-Liqueur.webp',0),(62,'Corn n Oil',2,1,15,8,'Cut the half lime in half again. Add the lime, falernum, and bitters to a rocks glass. Muddle. Add the rum. (Aged Barbados rum such as Plantation 5 Year is recommended). Add ice and stir. Float the blackstrap rum on top. Serve with a straw.','Corn-n-Oil.webp',0),(63,'Corpse Reviver',2,1,5,3,'Shake, strain, straight up, cocktail glass rinsed with absinthe','Corpse-Reviver.webp',0),(64,'Cosmopolitan',2,1,5,1,'Add all ingredients into cocktail shaker filled with ice. Shake well and double strain into large cocktail glass. Garnish with lime wheel.','Cosmopolitan.webp',0),(65,'Cream Soda',2,1,10,2,'Pour 1oz of Spiced Rum into a highball glass with ice. Fill with Ginger Ale.','Cream-Soda.webp',0),(66,'Cuba Libre',6,1,10,8,'Build all ingredients in a Collins glass filled with ice. Garnish with lime wedge.','Cuba-Libre.webp',0),(67,'Daiquiri',6,1,5,10,'Pour all ingredients into shaker with ice cubes. Shake well. Strain in chilled cocktail glass.','Daiquiri.webp',0),(68,'Dark and Stormy',6,1,10,8,'In a highball glass filled with ice add 6cl dark rum and top with ginger beer. Garnish with lime wedge.','Dark-and-Stormy.webp',0),(69,'Dark Caipirinha',2,1,10,3,'Muddle the sugar into the lime wedges in an old-fashioned glass.\nFill the glass with ice cubes.\nPour the cachaca into the glass.\nStir well.','Dark-Caipirinha.webp',0),(70,'Darkwood Sling',11,1,5,1,'There are many good cherry liqueurs you can use, but I prefere Heering. Add one share of the liqueur. Then you add one share of Soda. For a sour sling use Tonic (most people prefer the drink without Tonic). Afterwards you fill the glass with Orange Juice and ice cubes.','Darkwood-Sling.webp',0),(71,'Death in the Afternoon',2,1,12,4,'Easy as you like, pour the absinthe into a chilled glass, top with champagne. Must be drunk mid afternoon for the optimum effect.','Death-in-the-afternoon.webp',0),(72,'Derby',6,1,5,9,'Pour all ingredients into a mixing glass with ice. Stir. Strain into a cocktail glass. Garnish with a sprig of fresh mint in the drink.','Derby.webp',0),(73,'Diesel',1,1,16,1,'Pour the lager first then add the blackcurrant cordial. Top up with the cider. The colour sholud be very dark approaching the colour of Guiness.','Diesel.webp',0),(74,'Dirty Martini',2,1,5,9,'Pour the vodka, dry vermouth and olive brine into a cocktail shaker with a handful of ice and shake well.\nRub the rim of a martini glass with the wedge of lemon.\nStrain the contents of the cocktail shaker into the glass and add the olive.\nA dirty Martini contains a splash of olive brine or olive juice and is typically garnished with an olive.','Dirty-Martini.webp',0),(75,'Dragonfly',6,1,10,9,'In a highball glass almost filled with ice cubes, combine the gin and ginger ale. Stir well. Garnish with the lime wedge.','Dragonfly.webp',0),(76,'Dry Martini',2,1,5,9,'Straight: Pour all ingredients into mixing glass with ice cubes. Stir well. Strain in chilled martini cocktail glass. Squeeze oil from lemon peel onto the drink, or garnish with olive.','Dry-Martini.webp',0),(77,'Dry Rob Roy',6,1,5,8,'In a mixing glass half-filled with ice cubes, combine the Scotch and vermouth. Stir well. Strain into a cocktail glass. Garnish with the lemon twist.','Dry-rob-roy.webp',0),(78,'Dubonnet Cocktail',6,1,5,1,'Stir all ingredients (except lemon peel) with ice and strain into a cocktail glass. Add the twist of lemon peel and serve.','Dubonnet-Cocktail.webp',0),(79,'Duchamp\'\'s Punch',2,1,15,3,'Shake all ingredients.\nDouble strain in a chilled double old fashioned glass with abig ice cube.\nGarnish with a couple of lavender sprigs','Duchamps-Punch.webp',0),(80,'Egg Cream',7,0,6,3,'Mix syrup and milk in a fountain glass. Add soda water, serve with a straw.','Egg-Cream.webp',0),(81,'Egg Nog - Healthy',8,1,7,10,'Whip egg substitute and sugar together, combine with the two kinds of milk, vanilla, and rum. Mix well. Chill over night. Sprinkle with nutmeg. Makes 6 servings.','Egg-Nog-Healthy.webp',0),(82,'Elderflower Caipirinha',2,1,7,9,'Take the glass and muddle the lime in it. Fill the glass with crushed ice and add the Cachaca. Stir well and top with some more crushed ice. Garnish with lime and enjoy!','Elderflower-Caipirinha.webp',0),(83,'English Highball',6,1,10,9,'Pour brandy, gin, and sweet vermouth into a highball glass over ice cubes. Fill with carbonated water. Add the twist of lemon peel, stir, and serve. (Ginger ale may be substituted for carbonated water, if preferred.)','English-Highball.webp',0),(84,'English Rose Cocktail',6,1,5,1,'Rub rim of cocktail glass with lemon juice and dip rim of glass in powdered sugar. Shake all ingredients (except cherry) with ice and strain into sugar-rimmed glass. Top with the cherry and serve.','English-Rose-Cocktail.webp',0),(85,'Espresso Martini',2,1,5,8,'Pour ingredients into shaker filled with ice, shake vigorously, and strain into chilled martini glass','Espresso-Martini.webp',0),(86,'Espresso Rumtini',2,1,5,8,'Mix together in a cocktail glass. Garnish with some choclate powder and coffee beans','Espresso-Rumtini.webp',0),(87,'Fahrenheit 5000',10,1,18,1,'Cover bottom of shot glass with Tabasco Sauce and then fill with half Firewater and half Absolut Peppar.','Fahrenheit-5000.webp',0),(88,'Figgy Thyme',2,1,10,7,'In a lewis bag, crush up some ice like a baller/maniac (@glacioice). Pour your precious ice into a collins glass. In a cocktail shaker, muddle the figs and thyme together. Add honey vodka, lemon juice, and a large ice cube (@glacioice). Shake until well chilled, and strain into glass. Add tonic water and finally 2 dashes of angostura bitters. Garnish with sliced figs and thyme.','Figgy-Thyme.webp',0),(89,'Flaming Dr Pepper',10,1,7,8,'Add Amaretto, Bacardi, and vodka. Mix in the Dr. Pepper and beer','Flaming- Dr-Pepper.webp',0),(90,'Flaming Lamborghini',2,1,5,8,'Pour the Sambuca and Kahlua into the Cocktail Glass and give the drinker a straw. Pour the Baileys and Blue Curacao into two sepsrate shot glasses either side of the cocktail glass. Set light the concotion in the cocktail glass and start to drink through the straw (this drink should be drunk in one) , as the bottom of the glass is reached put out the fire by pouring the Baileys and Blue Curacao into the cocktail glass and keep drinking till it\'\'s all gone!!','Flaming-Lamborghini.webp',0),(91,'Flying Dutchman',6,1,15,3,'In an old-fashioned glass almost filled with ice cubes, combine the gin and triple sec. Stir well.','Flying-Dutchman.webp',0),(92,'Flying Scotchman',6,1,5,1,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Flying-Scotchman.webp',0),(93,'Foxy Lady',6,1,5,7,'Shake all ingredients with ice, strain into a chilled cocktail glass, and serve.','Foxy-Lady.webp',0),(94,'Frapp',4,0,10,3,'Mix together. Blend at highest blender speed for about 1 minute. Pour into a glass and drink with a straw. Notes: This works best if everything is cold (if you make fresh coffee, mix it with the milk and let it sit in the fridge for 1/2 hour. If it is not frothy, add more milk, or even just some more milk powder. The froth gradually turns to liquid at the bottom of the glass, so you will find that you can sit and drink this for about 1/2 hour, with more iced coffee continually appearing at the bottom. Very refreshing.','Frapp.webp',0),(95,'French 75',6,1,7,3,'Combine gin, sugar, and lemon juice in a cocktail shaker filled with ice. Shake vigorously and strain into a chilled champagne glass. Top up with Champagne. Stir gently.','French-75.webp',0),(96,'French Connection',6,1,15,8,'Pour all ingredients directly into old fashioned glass filled with ice cubes. Stir gently.','French-Connection.webp',0),(97,'French Martini',2,1,5,7,'Pour all ingredients into shaker with ice cubes. Shake well and strain into a chilled cocktail glass. Squeeze oil from lemon peel onto the drink.','French-Martini.webp',0),(98,'French Negroni',2,1,13,1,'Add ice to a shaker and pour in all ingredients.\nUsing a bar spoon, stir 40 to 45 revolutions or until thoroughly chilled.\nStrain into a martini glass or over ice into a rocks glass. Garnish with orange twist.','French-Negroni.webp',0),(99,'Frisco Sour',6,1,19,3,'Shake all ingredients (except slices of lemon and lime) with ice and strain into a whiskey sour glass. Decorate with the slices of lemon and lime and serve.','Frisco-Sour.webp',0),(100,'Fros',2,1,5,7,'Step 1\nPour ros into a 13x9\" pan and freeze until almost solid (it won\'\'t completely solidify due to the alcohol), at least 6 hours.\n\nStep 2\nMeanwhile, bring sugar and  cup water to a boil in a medium saucepan; cook, stirring constantly, until sugar dissolves, about 3 minutes. Add strawberries, remove from heat, and let sit 30 minutes to infuse syrup with strawberry flavor. Strain through a fine-mesh sieve into a small bowl (do not press on solids); cover and chill until cold, about 30 minutes.\n\nStep 3\nScrape ros into a blender. Add lemon juice, 3 ounces strawberry syrup, and 1 cup crushed ice and pure until smooth. Transfer blender jar to freezer and freeze until fros is thickened (aim for milkshake consistency), 2535 minutes.\n\nStep 4\nBlend again until fros is slushy. Divide among glasses.\n\nStep 5\nDo Ahead: Ros can be frozen 1 week ahead.','Fros.webp',0),(101,'Frozen Daiquiri',6,1,4,3,'Combine all ingredients (except for the cherry) in an electric blender and blend at a low speed for five seconds, then blend at a high speed until firm. Pour contents into a champagne flute, top with the cherry, and serve.','Frozen-Daiquiri.webp',0),(102,'Frozen Mint Daiquiri',6,1,15,4,'Combine all ingredients with 1 cup of crushed ice in an electric blender. Blend at a low speed for a short length of time. Pour into an old-fashioned glass and serve.','Frozen-Mint-Daiquiri.webp',0),(103,'Frozen Pineapple Daiquiri',6,1,5,3,'Combine all ingredients with 1 cup of crushed ice in an electric blender. Blend at a low speed for a short length of time. Pour into a cocktail glass and serve.','Frozen-Pineapple-Daiquiri.webp',0),(104,'Fruit Flip-Flop',7,0,10,3,'Place all ingredients in the blender jar - cover and whiz on medium speed until well blended. Pour in one tall, 2 medium or 3 small glasses and drink up.','Fruit-Flip-Flop.webp',0),(105,'Funk and Soul',2,1,7,7,'Mix all ingredients together and strain into a Collins glass. Use Jamaican rum where possible for a more authentic taste.','Funk-and-Soul.webp',0),(106,'Gagliardo',2,1,5,7,'Shake well and serve in a cocktail glass. This is a home cocktail of American/Internet Bar del Pozzo, Pavia, Italy.','Gagliardo.webp',0),(107,'Gimlet',2,1,13,3,'Add all the ingredients to a shaker and fill with ice.\n\nShake, and strain into a chilled cocktail glass or an Old Fashioned glass filled with fresh ice.\n\nGarnish with a lime wheel.','Gimlet.webp',0),(108,'Gin and Soda',2,1,10,9,'Pour the Gin and Soda water into a highball glass almost filled with ice cubes.\nStir well.\nGarnish with the lime wedge.','Gin-and-Soda.webp',0),(109,'Gin Cooler',6,1,7,9,'Stir powdered sugar and 2 oz. carbonated water in a collins glass. Fill glass with ice and add gin. Fill with carbonated water and stir. Add the lemon peel and the orange spiral so that the end of the orange spiral dangles over rim of glass.','Gin-Cooler.webp',0),(110,'Gin Daisy',6,1,15,7,'In a shaker half-filled with ice cubes, combine the gin, lemon juice, sugar, and grenadine. Shake well. Pour into an old-fashioned glass and garnish with the cherry and the orange slice.','Gin-Daisy.webp',0),(111,'Gin Fizz',6,1,10,9,'Shake all ingredients with ice cubes, except soda water. Pour into glass. Top with soda water.','Gin-Fizz.webp',0),(112,'Gin Lemon',2,1,10,3,'For the preparation of the gin lemon you will not need the shaker. Fill the tumbler with ice, pour the gin and lemonade over it. Gently mix and decorate with a slice of lemon. Those who prefer can also add a few mint leaves. Your gin lemon is ready to be served.','Gin-lemon.webp',0),(113,'Gin Rickey',2,1,10,9,'Half-fill a tall glass with ice. Mix the gin and Grenadine together and pour over the ice. Add the lime or lemon juice and top off with soda water. Decorate the glass with lime and/or lemon slices.','Gin-Rickey.webp',0),(114,'Gin Sling',6,1,15,9,'Dissolve powdered sugar in mixture of water and juice of lemon. Add gin. Pour into an old-fashioned glass over ice cubes and stir. Add the twist of orange peel and serve.','Gin-Sling.webp',0),(115,'Gin Smash',6,1,15,9,'Muddle sugar with carbonated water and mint sprigs in an old-fashioned glass. Add gin and 1 ice cube. Stir, add the orange slice and the cherry, and serve.','Gin-Smash.webp',0),(116,'Gin Sour',6,1,19,3,'In a shaker half-filled with ice cubes, combine the gin, lemon juice, and sugar. Shake well. Strain into a sour glass and garnish with the orange slice and the cherry.','Gin-Sour.webp',0),(117,'Gin Tonic',2,1,10,9,'Fill a highball glass with ice, pour the gin, top with tonic water and squeeze a lemon wedge and garnish with a lemon wedge.','Gin-Tonic.webp',0),(118,'Grand Blue',6,1,15,5,'Serve in an old fashioned glass.','Grand-Blue.webp',0),(119,'Grasshopper',6,1,5,4,'Pour ingredients into a cocktail shaker with ice. Shake briskly and then strain into a chilled cocktail glass.','Grasshopper.webp',0),(120,'Greyhound',2,1,7,1,'Add the vodka to a Collins glass filled with ice.\nTop with grapefruit juice and stir.','Greyhound.webp',0),(121,'Harvey Wallbanger',6,1,7,3,'Stir the vodka and orange juice with ice in the glass, then float the Galliano on top. Garnish and serve.','Harvey-Wallbanger.webp',0),(122,'Havana Cocktail',6,1,5,3,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a cocktail glass.','Havana-Cocktail.webp',0),(123,'Hawaiian Cocktail',6,1,5,5,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Hawaiian-Cocktail.webp',0),(124,'Highland Fling Cocktail',6,1,5,2,'Stir all ingredients (except olive) with ice and strain into a cocktail glass. Add the olive and serve.','Highland-Fling-Cocktail.webp',0),(125,'Imperial Fizz',6,1,10,3,'Shake all ingredients (except carbonated water) with ice and strain into a highball glass over two ice cubes. Fill with carbonated water, stir, and serve.','Imperial_Fizz.webp',0),(126,'Ipamena',6,0,21,3,'Cut half a lime into pieces, place in a shaker, add the sugar and crush. Measure the passion fruit juice, add it to the shaker and fill up with ice cubes. Close the shaker and shake vigorously. Pour the liquid into a glass, top up with ginger ale, stir with a teaspoon and then garnish the rim of the glass with a slice of lime','Ipanema.webp',0),(127,'Irish Spring',6,1,7,3,'Pour all ingredients (except orange slice and cherry) into a collins glass over ice cubes. Garnish with the slice of orange, add the cherry on top, and serve.','Irish-Spring.webp',0),(128,'Jack Rose Cocktail',6,1,5,1,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Jack-Rose.webp',0),(129,'Jack\'\'s Vanilla Coke',7,1,15,8,'After pouring in your ingredients, and adding 3-5 ice cubes, according to taste. Stir the drink with a stirrer to get the Vanilla off the bottom.','Jack-s-Vanilla-Coke.webp',0),(130,'Just a Moonmint',9,0,10,8,'Place all ingredients in the blender jar - cover and whiz on medium speed until well blended. Pour in one tall, 2 medium or 3 small glasses and drink up.','Just-a-Moonmint.webp',0),(131,'Karsk',6,1,10,8,'Put a copper coin in a coffe-cup and fill up with coffee until you no longer see the coin, then add alcohol until you see the coin. Norwegian speciality.','Karsk.webp',0),(132,'Kirr Royale',6,1,4,1,'Pour Creme de cassis in glass, gently pour champagne on top','Kirr-Royale.webp',0),(133,'Kiss me Quick',6,1,10,1,'Mix in the glass','Kiss-me-Quick.webp',0),(134,'Kiwi Lemon',6,1,10,4,'Mix in highball glass. Stirr. Garnish with slice of kiwi.','Kiwi-Lemon.webp',0),(135,'Kool First Aid',10,1,18,1,'Add Kool Aid to a double shot glass, and top with rum. Slam and shoot.','Kool-First-Aid.webp',0),(136,'Lady Love Fizz',6,1,5,10,'Shake all ingredients (except carbonated water) with ice and strain into a cocktail glass over two ice cubes. Fill with carbonated water, stir, and serve.','Lady-Love-Fizz.webp',0),(137,'Lazy Coconut Paloma',2,1,10,7,'Mix the coconut liqueur (preferably tequila) with the grapefruit juice and top with soda water. Garnish with a large grapefruit slice against the inside of the glass.','Lazy-Coconut_Paloma.webp',0),(138,'Lemon Shot',10,1,18,3,'Mix Galliano and Absolut Citron in a shot glass, lay lemon wedge sprinkled with sugar over glass and pour a rum over wedge and glass. light rum with a lighter and let burn for a second. Do shot quickly and suck on lemon. If it is done correctly, this will taste like a shot of sweet lemonade.','Lemon-shot.webp',0),(139,'Tequila Limeade',7,0,10,3,'In a large glass, put the lime juice and sugar, and stir well. Add cold seltzer water to fill. Put the lime peels in the glass. Drink. Repeat until limes or soda run out.','Tequila_Limeade.webp',0),(140,'Loch Lomond',6,1,5,8,'In a mixing glass half-filled with ice cubes, combine the Scotch, Drambuie, and vermouth. Stir well. Strain into a cocktail glass. Garnish with the lemon twist.','Loch-Lomond.webp',0),(141,'Mai Tai',6,1,7,3,'Shake all ingredients with ice. Strain into glass. Garnish and serve with straw.','Mai-Tai.webp',0),(142,'Manhattan',2,1,5,1,'Stirred over ice, strained into a chilled glass, garnished, and served up.','Manhattan.webp',0),(143,'Margarita',6,1,5,3,'Rub the rim of the glass with the lime slice to make the salt stick to it. Take care to moisten only the outer rim and sprinkle the salt on it. The salt should present to the lips of the imbiber and never mix into the cocktail. Shake the other ingredients with ice, then carefully pour into the glass.','Margarita.webp',0),(144,'Martini',2,1,5,9,'Straight: Pour all ingredients into mixing glass with ice cubes. Stir well. Strain in chilled martini cocktail glass. Squeeze oil from lemon peel onto the drink, or garnish with olive.','Martini.webp',0),(145,'Miami Vice',2,1,5,1,'First: Mix pina colada with 2.5 oz. of rum with ice(set aside). Second: Mix daiquiri with 2.5 oz. of rum with ice. Third: While frozen, add pina colda mix then daiquiri mix in glass (Making sure they do not get mixed together).','Miami-Vice.webp',0),(146,'Mimosa',6,1,4,3,'Ensure both ingredients are well chilled, then mix into the glass. Serve cold.','Mimosa.webp',0),(147,'Mojito',2,1,10,9,'Muddle mint leaves with sugar and lime juice. Add a splash of soda water and fill the glass with cracked ice. Pour the rum and top with soda water. Garnish and serve with straw.','Mojito.webp',0),(148,'Mulled Wine Margarita',8,1,7,1,'Simmer 3 cups water with, sugar, cloves, cinnamon sticks, and lemon peel in a stainless steel pot for 10 minutes. Add wine heat to a \"coffee temperature\" (DO NOT BOIL) then add the brandy.','Mulled-wine-margarita.webp',0),(149,'Munich Mule',2,1,10,9,'Fill glass with ice\nPour Gin and Lime Juice\nFill glass with Ginger Beer\nGarnish with Cucumer and Lime slice','Munich-Mule.webp',0),(150,'Negroni',6,1,15,1,'Stir into glass over ice, garnish and serve.','Negroni.webp',0),(151,'Old Cuban',2,1,5,8,'Shake a handful of mint, 2oz white rum, 1oz of sugar syrup, 1oz lime juice and 2 dashes angostura bitters with ice. Double strain into a glass and top with 2oz of prosecco.','Old-Cuban.webp',0),(152,'Old Fashioned',2,1,15,8,'Place sugar cube in old fashioned glass and saturate with bitters, add a dash of plain water. Muddle until dissolved.\nFill the glass with ice cubes and add whiskey.\n\nGarnish with orange twist, and a cocktail cherry.','Old-fashioned.webp',0),(153,'Old Pal',2,1,14,1,'Chill cocktail glass. Add ingredients to a mixing glass, and fill 2/3 full with ice. Stir about 20 seconds. Empty cocktail glass and strain into the glass. Garnish with a twist of lemon peel.','Old-Pal.webp',0),(154,'Quaker\'\'s Cocktail',6,1,5,7,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Quaker-s-Cocktail.webp',0),(155,'Raspberry Julep',2,1,8,1,'Softly muddle the mint leaves and raspberry syrup in the bottom of the cup. Add crushed ice and Bourbon to the cup and then stir. Top with more ice, garnish with a mint sprig.','Raspberry-Julep.webp',0),(156,'Rosemary Blue',2,1,1,5,'1) Add the Bombay Sapphire, Blue Curacao, rosemary sprig and gently squeezed lemon wedge to a balloon glass. Swirl well to combine.\n2) Fill with cubed ice and top with the Fever-Tree Light Tonic Water.\n3) Gently fold with a bar spoon to mix.','Rosemaryblue.webp',0),(157,'Royal Gin Fizz',6,1,10,10,'Shake all ingredients (except carbonated water) with ice and strain into a highball glass over two ice cubes. Fill with carbonated water, stir, and serve.','Royal-Gin-Fizz.webp',0),(158,'Rum Punch',8,1,17,2,'Mix all ingredients in a punch bowl and serve.','Rum-Punch.webp',0),(159,'San Francisco',6,1,10,1,'Take a tall glass and put in a few ice cubes, fill the vodka over it and fill with juice then the \"creme\", to end fill in the grenadine but very carefully at the side of the glass so it will lay down in the bottom. garnish with orange and strawberry.','San-Francisco.webp',0),(160,'Sea Breeze',6,1,10,1,'Build all ingredients in a highball glass filled with ice. Garnish with lime wedge.','Sea-Breeze.webp',0),(161,'Snowball',6,1,10,3,'Place one ice cube in the glass and add 1 1/2 oz of Advocaat. Fill up the glass with lemonade and decorate with a slice of lemon. Serve at once.','Snowball.webp',0),(162,'Spritz',6,1,15,1,'Build into glass over ice, garnish and serve.','Spritz.webp',0),(163,'Tequila Sunrise',2,1,10,1,'Pour the tequila and orange juice into glass over ice. Add the grenadine, which will sink to the bottom. Stir gently to create the sunrise effect. Garnish and serve.','Tequila-sunrise.webp',0),(164,'Thriller',6,1,5,3,'In a shaker half-filled with ice cubes, combine all of the ingredients. Shake well. Strain into a cocktail glass.','Thriller.webp',0),(165,'Tia-Maria',5,1,7,8,'Boil water, sugar and coffe for 10 mins and let cool. Add rum and vanilla. Put in clean bottle(s) and leave for 1 week before using.','Tia-Maria.webp',0),(166,'Tuxedo Cocktail',6,1,5,7,'Stir all ingredients with ice and strain into a cocktail glass. Garnish with a cherry and a twist of lemon zest.','Tuxedo-Cocktail.webp',0),(167,'Valencia Cocktail',6,1,5,3,'Shake all ingredients with ice, strain into a cocktail glass, and serve.','Valencia-Cocktail.webp',0),(168,'Vampiro',6,1,15,1,'Vampiros may be made in a tall glass or an old fashioned glass. Bartenders may first \"rim\" the glass with Kosher Salt, which is done by placing a layer of Kosher Salt on a chopping board, moistening the glass\'\' rim with lime juice or water, and then placing the upside down glass rim onto the Kosher Salt, so that the salt sticks to the moistened rim. The second step is to fill half the glass with ice and add one or two shooter glasses full of high quality Tequila. The next stage is to add the flavouring elements. This is done by squeezing a fresh lime into the glass, adding a few grains of salt, adding citrus-flavoured soda pop, until the glass is 4/5 full, and then adding spicy Viuda de Sanchez (or orange juice, lime juice and pico de gallo). The final step is to stir the ingredients so that the flavours are properly blended.','Vampiro.webp',0),(169,'Vodka Martini',6,1,5,9,'Shake the vodka and vermouth together with a number of ice cubes, strain into a cocktail glass, add the olive and serve.','Vodka-Martini.webp',0),(170,'Vodka Tonic',2,1,10,9,'Wash and cut 1 wedge and 1 slice of lime or lemon.\nFill a tumbler with fresh ice.\nPour the desired dose of vodka and top up with the tonic.\nSqueeze the lime wedge into the glass and decorate with the slice.\nThat\'\'s all, very simple: it\'\'s just the recipe for happiness!','Vodka-Tonic.webp',0),(171,'Whisky Mac',6,1,7,8,'Pour both of the ingredients into a wine goblet with no ice.','Whisky-Mac.webp',0),(172,'Yellow Bird',2,1,5,3,'Shake and strain into a chilled cocktail glass','Yellow-Bird.webp',0),(173,'Zombie',2,1,11,2,'Blend at high speed for no more than 5 seconds.\n\nPour into a glass, add ice cubes to fill, then add the garnish.\n\n*Donns mix: Bring 3 crushed cinnamon sticks, 1 cup of sugar and 1 cup of water to a boil, stirring until the sugar is dissolved.\n\nSimmer for 2 minutes, then remove from the heat and let sit for at least 2 hours before straining into a clean glass bottle.\n\nThen add 1 part of the syrup and 2 parts of fresh grapefruit juice together.','Zombie.webp',0),(174,'Zorro',4,1,6,5,'add all and pour black coffee and add whipped cream on top.','Zorro.webp',0);
